import Header from "../components/header";
import { useState } from "react";
import AllDbData from "./dbdata";
import ReactPaginate from 'react-paginate';

export default function ViewEnquery(){

  const edata = AllDbData.EnquiryData;

console.log(AllDbData.EnquiryData);


const [itemOffset, setItemOffset] = useState(0);

// const pageCount = Math.ceil(items.length / itemsPerPage);
const handlePageClick = (event) => {
  const newOffset = (event.selected * 5) % edata.length;
  // console.log(
  //   `User requested page number ${event.selected}, which is offset ${newOffset}`
  // );
  setItemOffset(newOffset);
};


    return(
        <>
        <Header/>
        <div className="container">
        {/* headind bar */}
        <div className="heading-bar">
            <h5 className="heading-h5">View Enquiry</h5>
        </div>
        {/* heading-bar end */}


        <div className="form-head">

        <div className="input-parent">
                <input className="form-control" type="search" name="search" placeholder="Search"/>
                </div>
<div>
<table>
  <tr>
    <th>Name</th>
    <th>Father Name	</th>
    <th>Phone	</th>
    <th>Father No.	</th>
    <th> Batch	</th>
    <th>Gander	</th>

    <th> Enquiry Date	</th>
    <th>Address	</th>
    <th> Demo Status	</th>
    <th>Admission Status	</th>
    <th>Status	</th>
    <th>	</th>
  </tr>

  {
        edata.map((edata) => (
          <tr>
          <td>{edata.name}</td>
          <td>{edata.father_name}</td>
          <td>7892002099</td>
          <td>7690860029 </td>
          <td>SSC</td>
          <td>male</td>
          <td>2023-06-25</td>
          <td>83LNP, SRI GANGANAGAR, RAJSTHAN</td>
          <td>Done</td>
          <td>Done</td>
          <td><button className="add-admission">Add Admission</button></td>
          <td></td>
        </tr>
        ))}

  <tr> 
    <td>ANUJ KUMAR</td>
    <td>VIJAYPAL</td>
    <td>7892002099</td>
    <td>7690860029 </td>
    <td>SSC</td>
    <td>male</td>
    <td>2023-06-25</td>
    <td>83LNP, SRI GANGANAGAR, RAJSTHAN</td>
    <td>Done</td>
    <td>Done</td>
    <td><button className="btn-enq-bg only-flex "><i class="fa fa-eye fafa-view-query"></i>View</button></td>
    <td className="only-flex"><button className="btn-enq-bg only-flex"><i class="fa fa-pencil fafa-view-query"></i> Edit</button>
    <button className="btn-enq-bg">Message</button>

    </td>
  </tr>
</table>

</div>
        </div>

        {/* container end */}
        </div>

      <ReactPaginate
        breakLabel="..."
        nextLabel="next >"
        onPageChange={handlePageClick}
        pageRangeDisplayed={5}
        pageCount={0}
        previousLabel="< previous"
        renderOnZeroPageCount={null}
      />


        </>




        )}
